import React from 'react';
import moment from 'moment';

export default function Calendar() {
    const weekdaysShort = moment.weekdaysShort();
    const weekdayHeader = weekdaysShort.map(day => {
        return (
            <th key={day} className="week-day">
                {day}
            </th>)
    })

    return (
        <div>
            <table>
<tr></tr>
            {weekdayHeader}
            </table>
        </div>
    )
}
